package movies;
import java.util.HashMap;
import java.util.Map;

public enum MovieDao {
    instance;

    private Map<String, Movie> contentProvider = new HashMap<>();

    private MovieDao() {

        Movie movie;
        movie = new Movie("1", "Lo que el viento se llevó", "Drama", "Victor Fleming", 1939, "Georgia, 1861. En la elegante mansión sureña de Tara, vive Scarlett O'Hara (Vivien Leigh), la joven más bella, caprichosa y egoísta de la región...", "data:image/jpeg;base64,");
        contentProvider.put(movie.getId(), movie);
        movie = new Movie("2", "Casablanca", "Drama", " Michael Curtiz", 1942, "Años 40. A consecuencia de la Segunda Guerra Mundial, Casablanca era una ciudad a la que llegaban huyendo del nazismo gente de todas partes...", "data:image/jpeg;base64,");
        contentProvider.put(movie.getId(), movie);
        movie = new Movie("3", "Posesion infernal", "Terror", "Sam Raimi", 1981, "Cinco chicos van a pasar el fin de semana a una cabaña perdida en un espeso bosque en las montañas de Tennessee...", "data:image/jpeg;base64,");
        contentProvider.put(movie.getId(), movie);

    }
    public Map<String, Movie> getModel(){
        return contentProvider;
    }

}